import React from "react";

const Home = () => {
  return (
    <aside className="w-72 bg-[#1c212c] min-h-full h-screen flex flex-col items-center pt-5 pb-2 space-y-7">
      {/* Menu Items */}
      <div className="w-full pr-3 flex flex-col gap-y-1 text-gray-500 fill-gray-500 text-sm">
        <div className="font-QuicksandMedium pl-4 text-gray-400/60 text-xs text-[11px] uppercase">Menu</div>

        <MenuItem label="Home" iconPath="M5 22h14a2 2 0 0 0 2-2v-9..." isActive={true} />
        <MenuItem label="Discovery" iconPath="M19 2H9c-1.11 0-2 .89-2..." />
        <MenuItem label="Friends" iconPath="M9 3C6.23858 3 4 5.23858..." />
        <MenuItem label="Coming soon" iconPath="M12 22C6.47715 22 2 17.5228..." />
      </div>

      {/* Profile Section */}
      <div className="w-full pr-3 flex flex-col gap-y-1 text-gray-500 fill-gray-500 text-sm">
        <div className="font-QuicksandMedium pl-4 text-gray-400/60 text-xs text-[11px] uppercase">Profile</div>
        <MenuItem label="Edit Profile" iconPath="M18.988 2.012 3 3..." />
        <MenuItem label="Settings" iconPath="M13.8199 22H10.1799..." />
      </div>
    </aside>
  );
};

const MenuItem = ({ label, iconPath, isActive }) => {
  return (
    <div className="w-full flex items-center gap-x-1.5 group select-none">
      <div
        className={`w-1 rounded-xl h-8 bg-transparent transition-colors duration-200 relative overflow-hidden ${
          isActive ? "bg-red-600" : ""
        }`}
      >
        <div className="absolute top-0 left-0 w-full h-[102%] translate-y-full group-hover:translate-y-0 bg-red-600 transition-all duration-300"></div>
      </div>
      <div className="group-hover:bg-white/10 w-full group-active:scale-95 self-stretch pl-2 rounded flex items-center space-x-2 transition-all duration-200 dark:group-hover:text-white text-sm">
        <svg className="h-5 w-5 group-hover:fill-red-600 dark:fill-gray-600 transition-colors duration-200" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">
          <path d={iconPath}></path>
        </svg>
        <span className="font-QuicksandMedium">{label}</span>
      </div>
    </div>
  );
};

export default Home;
